        axios.get("https://drug-info-and-price-history.p.rapidapi.com/1/druginfo?drug", {
            "headers": {
                'X-RapidAPI-Key': 'c8a8e86c4bmshaf6ec9cd4fafff7p1bc63ejsn8b52e0af2dde',
                'X-RapidAPI-Host': 'drug-info-and-price-history.p.rapidapi.com'
            }
        })
            .then(res => {
                setMedicine(res.data);
                console.log(res.data);
            })
            .catch(err => {
                console.log(err);
            });
    }

    return (
        <div>
            <h1>Medications</h1>
            <form>
                <label>Search</label>
                <input type="text" />
                <input type="submit" />
            </form>
        </div>
    )
}

